import React from 'react';
import {CopyRight, FooterBottom, FooterContainer, FooterLogo, FooterTop, PaymentMethods, SocialButtons} from "./style";
import {Container} from "../../assets/styles";
import {FaceBook, Instagram, MasterCard, PayPal, Visa, WebMoney, YouTube} from "../../assets/icons";
import {IconButton} from "../IconButton/IconButton";
import {Logo} from "../Logo/Logo";
import {Buttons} from "../UI";
import {Button} from "../Button/Button";


const Footer = () => {
    return (
        <FooterContainer>
            <Container>
                <FooterTop></FooterTop>
                <FooterBottom>
                    <FooterLogo>
                        <Logo/>
                        <CopyRight>© WellFitness. 2007 Все права защищены</CopyRight>
                    </FooterLogo>
                    <SocialButtons>
                        <IconButton>
                            <Instagram/>
                        </IconButton>
                        <IconButton>
                            <YouTube/>
                        </IconButton>
                        <IconButton>
                            <FaceBook/>
                        </IconButton>
                    </SocialButtons>
                    <Buttons>
                        <Button>Become a Partner</Button>
                        <Button>Для дилеров</Button>
                    </Buttons>
                    <PaymentMethods>
                        <Visa/>
                        <MasterCard/>
                        <PayPal/>
                        <WebMoney/>
                    </PaymentMethods>
                </FooterBottom>
            </Container>
        </FooterContainer>
    );
};

export default Footer;
